import React from 'react';
import NavBar from './Navbar';
import Images from './Images';

export default function Features(){
    return (
        <>
        <NavBar />
        <div className="container">
            <div className="row mt-4">
                <div className="col-4">
                <img src={Images.features_insurance} width="120%"></img>
                </div>
            </div>
        </div>        
        </>
    );
}
